def average_and_median(numbers):
    if not numbers:
        return None, None
    avg = sum(numbers) / len(numbers)
    nums = sorted(numbers)
    n = len(nums)
    if n % 2 == 1:
        med = nums[n // 2]
    else:
        med = (nums[n // 2 - 1] + nums[n // 2]) / 2
    return avg, med

