    from collections import defaultdict
    grouped = defaultdict(list)
    for word in words:
        if word:
            grouped[word[0]].append(word)
    return dict(grouped)

def rotate_right(lst, k):
    if not lst:
        return lst
    k = k % len(lst)
    return lst[-k:] + lst[:-k]
